import React, { useState, useEffect } from 'react'
import { Button, Card, Select } from 'antd';
import { Line } from '@antv/g2plot';
import { GraphDataFind } from '../../DataRequest/RealTimeRequestWrap';

const { Option } = Select;
let line
let Graph = [], OptionSelected = []


const RealTimeGraphWrapper = (props) => {

    const LabelOption = []
    const LabelList = Object.keys(props.DataModel)

    LabelList.forEach(element => {
        LabelOption.push(<Option key={element}>{element}</Option>);
    });

    const handleChange = (value) => {
        OptionSelected = value
    }

    const HistoryClear = () => {
        props.ClearHistoryCallBack()
    }

    const UpdateData = () => {
        console.log(OptionSelected);
        console.log(props.GraphData);

        Graph = GraphDataFind(OptionSelected, props.GraphData)

        if (Graph.length === 0) {
            console.log('Undefine data');
        }

        else {
            Graph.forEach(element => {
                Graph.push(element)
            });
            try {
                line.changeData(Graph)
            }
            catch { }
        }
    }


    useEffect(() => {
        console.log('Reffect');

        line = new Line(props.Divname, {
            data: Graph,
            xField: 'time',
            yField: 'Value',
            seriesField: 'Label',
        });
        line.render();

        return () => {
            console.log('un');
            line.destroy();
        }
    }, [])

    console.log('asda');

    return (
        <div >
            <div>

                <Select
                    mode="multiple"
                    placeholder="Please select"
                    onChange={handleChange}
                    style={{ width: '100%' }}
                >
                    {LabelOption}
                </Select>

                <Button onClick={HistoryClear}> Clear </Button>

            </div>

            <Card title={props.GarphTitle} bordered={true} style={{ width: '100%', borderRadius: 15, backgroundColor: '#f0f9fa' }} hoverable={true}>
                <div id={props.Divname}></div>
            </Card>

        </div>
    )
}

export default RealTimeGraphWrapper
